import React from "react";
import "./Buttons.css";

const ButtonPlay = ({ icon, onClick }) => {
  return (
    <button className="btn btn-play" onClick={onClick}>
      <ion-icon name={icon} />
    </button>
  );
};

const mapDispatchToProps = () => {
  return { btnPlay };
};

export default connect(
  null,
  mapDispatchToProps
)(ButtonPlay);
